{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/valerywafula/does-brain-volume-affect-cognitive-function?scriptVersionId=190444983\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"a79e5ee7","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.012332,"end_time":"2024-07-30T12:40:47.249892","exception":false,"start_time":"2024-07-30T12:40:47.23756","status":"completed"},"tags":[]},"source":["# Introduction and background #\n","The volume of the brain is a crucial factor that can significantly impact cognitive function. Research has shown that variations in brain volume, particularly in specific regions, are associated with differences in cognitive abilities such as memory, attention, processing speed, and problem-solving skills. For instance, a larger hippocampal volume is often linked to better memory performance, while reductions in prefrontal cortex volume can be associated with diminished executive function and decision-making capabilities. Various factors, including genetics, age, health conditions, and lifestyle choices, can influence brain volume. Understanding the relationship between brain volume and cognitive function is not just interesting, but essential for developing strategies to maintain and improve cognitive health throughout the lifespan.\n","\n","This study utilizes a cross-sectional MRI dataset of 416 right-handed subjects aged 18 to 96, each with 3 or 4 T1-weighted scans. It includes 100 subjects over 60 diagnosed with mild to moderate Alzheimer's disease (AD) and a reliability subset of 20 nondemented subjects re-imaged within 90 days. This dataset allows for a detailed analysis of the impact of brain volume on cognitive function across various ages and cognitive states."]},{"cell_type":"markdown","id":"ab0ec0e2","metadata":{"papermill":{"duration":0.010189,"end_time":"2024-07-30T12:40:47.27101","exception":false,"start_time":"2024-07-30T12:40:47.260821","status":"completed"},"tags":[]},"source":["# Research Questions #\n","1.Does cognitive function differ by gender?\n","\n","2.How does age and the volume of the brain impact cognitive function?\n","\n","3.How does cognitive function vary by SES (Socioeconomic Status)\n"]},{"cell_type":"markdown","id":"b273deda","metadata":{"papermill":{"duration":0.010244,"end_time":"2024-07-30T12:40:47.291232","exception":false,"start_time":"2024-07-30T12:40:47.280988","status":"completed"},"tags":[]},"source":["# Dependent Variable #\n","MMSE_Score: Mini-Mental State Examination score, which measures cognitive function."]},{"cell_type":"markdown","id":"a1116bc8","metadata":{"papermill":{"duration":0.010032,"end_time":"2024-07-30T12:40:47.311745","exception":false,"start_time":"2024-07-30T12:40:47.301713","status":"completed"},"tags":[]},"source":["# Independent Variables #\n","Age: Age of the participant.\n","\n","Gender: Gender of the participant.\n","\n","nWBV: Normalized Whole Brain Volume, representing the brain volume normalized to the intracranial volume.\n","\n","SES: Socioeconomic Status"]},{"cell_type":"markdown","id":"644aa621","metadata":{"papermill":{"duration":0.010044,"end_time":"2024-07-30T12:40:47.332329","exception":false,"start_time":"2024-07-30T12:40:47.322285","status":"completed"},"tags":[]},"source":["# Objective #\n","The study is aimed at understanding the relationship between the brain structure and cognitive function.\n","\n","The study will investigate the impact of demographic factors (age, sex, SES) on cognitive function."]},{"cell_type":"markdown","id":"fba6ba89","metadata":{"papermill":{"duration":0.010009,"end_time":"2024-07-30T12:40:47.352317","exception":false,"start_time":"2024-07-30T12:40:47.342308","status":"completed"},"tags":[]},"source":["# Load Packages#\n","\n","## Install and load common packages