ional %>%\n","    filter(!is.na(Age) & !is.na(MMSE))\n","ggplot(clean_data, aes(x = Age, y = MMSE)) +\n","    geom_point(color = \"orange\", alpha = 0.6) +\n","    geom_smooth(method = \"lm\", color = \"black\") +\n","    labs(title = \"Scatterplot of Age vs. MMSE Score\",\n","         x = \"Age\",\n","         y = \"MMSE Score\") +\n","    theme_minimal()"]},{"cell_type":"markdown","id":"fee712bd","metadata":{"papermill":{"duration":0.019131,"end_time":"2024-07-30T12:40:54.251843","exception":false,"start_time":"2024-07-30T12:40:54.232712","status":"completed"},"tags":[]},"source":["There is a negative correlation between Mini-Mental State Examination (MMSE) score and Age.\n","Older participants have lower MMSE scores.\n"]},{"cell_type":"markdown","id":"d181a4a6","metadata":{"papermill":{"duration":0.018789,"end_time":"2024-07-30T12:40:54.289412","exception":false,"start_time":"2024-07-30T12:40:54.270623","status":"completed"},"tags":[]},"source":["# Inferential Analysis #"]},{"cell_type":"markdown","id":"083cdb72","metadata":{"papermill":{"duration":0.018875,"end_time":"2024-07-30T12:40:54.327084","exception":false,"start_time":"2024-07-30T12:40:54.308209","status":"completed"},"tags":[]},"source":["## Does cognitive function differ by gender? ##\n","### (µ1 = average MMSE score of male respondents, µ2 = average MMSE score of female respondents). ###\n","### Null Hypothesis (H0): There is no significant difference between the average MMSE score of Male and female respondents (µ1 = µ2). ###\n","### Alternative Hypothesis (H1): There is a significant difference between the average MMSE score of Male and female respondents (µ1 ≠ µ2). ###\n","\n"]},{"cell_type":"code","execution_count":15,"id":"2c4ba464","metadata":{"execution":{"iopub.execute_input":"2024-07-30T12:40:54.369577Z","iopub.status.busy":"2024-07-30T12:40:54.367597Z","iopub.status.idle":"2024-07-30T12:40:54.39941Z","shell.execute_reply":"2024-07-30T12:40:54.397279Z"},"papermill":{"duration":0.056321,"end_time":"2024-07-30T12:40:54.402232","exception":false,"start_time":"2024-07-30T12:40:54.345911","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\n","\tTwo Sample t-test\n","\n","data:  MMSE by M/F\n","t = 0.80053, df = 214, p-value = 0.4243\n","alternative hypothesis: true difference in means between group F and group M is not equal to 0\n","95 percent confidence interval:\n"," -0.5832005  1.3808693\n","sample estimates:\n","mean in group F mean in group M \n","       27.45517        27.05634 \n","\n"]}],"source":["# Clean the data by removing rows with NA values in Gender or MMSE_Score\n","  clean_data <- oasis_cross_sectional %>%\n","    filter(!is.na(`M/F`) & !is.na(MMSE))\n","# Ensure Gender is a factor\n","  clean_data$`M/F` <- as.factor(clean_data$`M/F`)\n","# Perform independent t-test\n","  t_test_result <- t.test(MMSE ~ `M/F`, data = clean_data, var.equal = TRUE) \n","# Print the t-test result\n","  print(t_test_result)\n"]},{"cell_type":"markdown","id":"c3829bdc","metadata":{"papermill":{"duration":0.018875,"end_time":"2024-07-30T12:40:54.440562","exception":false,"start_time":"2024-07-30T12:40:54.421687","status":"completed"},"tags":[]},"source":["We fail to reject the null hypothesis. There is no significant variation in average MMSE score of male and female respondents (*t* (214) = 0.800, *p* > .05).\n","\n","The mean MMSE score of Male respondents (\n","*MEAN* = 27.46) and that of female participants (\n","*MEAN* = 27.06) are roughly equal."]},{"cell_type":"markdown","id":"18d4b875","metadata":{"papermill":{"duration":0.01873,"end_time":"2024-07-30T12:40:54.478085","exception":false,"start_time":"2024-07-30T12:40:54.459355","status":"completed"},"tags":[]},"source":["## How does age and the volume of the brain impact cognitive function? ##\n","### Null Hypothesis (H0): Age and the volume of the brain are not significant predictors of cognitive function. ###\n","### Alternative Hypothesis (H1): Age and the volume of the brain are significant predictors of cognitive function. ###"]},{"cell_type":"code","execution_count":16,"id":"3fab7b21","metadata":{"execution":{"iopub.execute_input":"2024-07-30T12:40:54.519264Z","iopub.status.busy":"2024-07-30T12:40:54.517649Z","iopub.status.idle":"2024-07-30T12:40:54.562252Z","shell.execute_reply":"2024-07-30T12:40:54.559683Z"},"papermill":{"duration":0.068849,"end_time":"2024-07-30T12:40:54.56573","exception":false,"start_time":"2024-07-30T12:40:54.496881","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["\n","Call:\n","lm(formula = MMSE ~ Age + nWBV, data = clean_data)\n","\n","Residuals:\n","     Min       1Q   Median       3Q      Max \n","-10.6107  -0.8537   0.4611   2.0161   5.6810 \n","\n","Coefficients:\n","            Estimate Std. Error t value Pr(>|t|)    \n","(Intercept) -3.95420    6.17111  -0.641    0.522    \n","Age          0.02626    0.02472   1.062    0.289    \n","nWBV        39.14203    6.30181   6.211 2.72e-09 ***\n","---\n","Signif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n","\n","Residual standard error: 3.02 on 213 degrees of freedom\n","Multiple R-squared:  0.235,\tAdjusted R-squared:  0.2278 \n","F-statistic: 32.72 on 2 and 213 DF,  p-value: 4.064e-13\n"]},"metadata":{},"output_type":"display_data"}],"source":["# Ensure that Brain_Volume and MMSE_Score are numeric\n","oasis_cross_sectional$nWBV <- as.numeric(oasis_cross_sectional$nWBV)\n","oasis_cross_sectional$MMSE <- as.numeric(oasis_cross_sectional$MMSE)\n","# Remove rows with NA values\n","clean_data <- oasis_cross_sectional %>%\n","  filter(!is.na(Age) & !is.na(nWBV ) & !is.na(MMSE))\n","# Perform multiple regression analysis\n","model <- lm(MMSE ~ Age + nWBV, data = clean_data)\n","summary(model)"]},{"cell_type":"markdown","id":"42a832ac","metadata":{"papermill":{"duration":0.019015,"end_time":"2024-07-30T12:40:54.609323","exception":false,"start_time":"2024-07-30T12:40:54.590308","status":"completed"},"tags":[]},"source":["The *R2* value (0.235) indicates that 23.5% of the total variation in the dependent variable (MMSE),  can be explained by the independent variables (age and brain volume).\n","\n","Independent variables statistically significantly predict MMSE score, *F*(2, 213) = 32.72, *p* < .05.\n","\n","Brain volume (nWBV) added statistically significantly to the prediction (p < .05).\n","Age is not a significant predictor of cognitive function (p > .05).\n","\n","The general form of the equation to predict MMSE from age and brain size (nWBV)  is:\n","predicted MMSE = -3.954 +  0.026 (Age) + 39.142 (nWBV)\n","One unit increase in brain size is associated with a 39.142 increase in MMSE, on average or else equal."]},{"cell_type":"markdown","id":"3787d3ab","metadata":{"papermill":{"duration":0.018739,"end_time":"2024-07-30T12:40:54.646821","exception":false,"start_time":"2024-07-30T12:40:54.628082","status":"completed"},"tags":[]},"source":["## How does cognitive function vary by SES (Socioeconomic Status)? ##\n","### (µ1 = mean MMSE score of the Low Income category, µ2 = mean MMSE score of the Lower Middle Income category, µ3 = mean MMSE score of the Middle Income category, µ4 = mean MMSE score of the Upper Middle Income category, µ5 = mean MMSE score of the High Income category). ###\n","### Null Hypothesis (H0): The mean MMSE score does not vary by SES (µ1 = µ2 = µ3 = µ4 = µ5). ###\n","### Alternative Hypothesis (H1): At least one of the k population means is not equal to the others (at least one µi is different).  ###"]},{"cell_type":"code","execution_count":17,"id":"ad74a0e4","metadata":{"execution":{"iopub.execute_input":"2024-07-30T12:40:54.688628Z","iopub.status.busy":"2024-07-30T12:40:54.686952Z","iopub.status.idle":"2024-07-30T12:40:54.75912Z","shell.execute_reply":"2024-07-30T12:40:54.756917Z"},"papermill":{"duration":0.096147,"end_time":"2024-07-30T12:40:54.761772","exception":false,"start_time":"2024-07-30T12:40:54.665625","status":"completed"},"tags":[]},"outputs":[