957  0.83467807\n","High Income-Upper Middle Income         -3.31292517  -8.746243  2.12039235\n","                                            p adj\n","Lower Middle Income-Low Income          0.9999739\n","Middle Income-Low Income                0.7393489\n","Upper Middle Income-Low Income          0.0160270\n","High Income-Low Income                  0.0511502\n","Middle Income-Lower Middle Income       0.7547627\n","Upper Middle Income-Lower Middle Income 0.0119536\n","High Income-Lower Middle Income         0.0532062\n","Upper Middle Income-Middle Income       0.3116087\n","High Income-Middle Income               0.1398878\n","High Income-Upper Middle Income         0.4499571\n","\n"]}],"source":["# Clean the data by removing rows with NA values in SES or MMSE_Score\n","  clean_data <- oasis_cross_sectional %>%\n","    filter(!is.na(SES) & !is.na(MMSE))\n","# Ensure SES is a factor\n","  clean_data$SES <- as.factor(clean_data$SES)\n","# Check for normality using Shapiro-Wilk test\n","  shapiro_test <- clean_data %>%\n","    group_by(SES) %>%\n","    summarise(p_value = shapiro.test(MMSE)$p.value)\n","  print(shapiro_test)\n","   # Perform one-way ANOVA\n","  anova_result <- aov(MMSE ~ SES, data = clean_data)\n","  summary(anova_result)\n","   # Post-hoc test using Tukey's HSD\n","  tukey_result <- TukeyHSD(anova_result)\n","  print(tukey_result)"]},{"cell_type":"markdown","id":"33bad97d","metadata":{"papermill":{"duration":0.01975,"end_time":"2024-07-30T12:40:54.801382","exception":false,"start_time":"2024-07-30T12:40:54.781632","status":"completed"},"tags":[]},"source":["We reject the null hypothesis (H0). Mean MMSE score is significantly different for at least one of the SES groups (*F* (4,211) = 4.841, *p* < .05).\n","\n","A Tukey post hoc test revealed that the average MMSE for the Low Income group was statistically significantly lower than that of the Upper Middle Income category (-2.10, *p* = .016). \n","\n","The mean MMSE for the Lower Middle Income group was statistically significantly lower than that of the Upper Middle Income category (-2.04, *p* = .011).\n","\n","There was no statistically significant difference between the rest of the groups (*p* > .05)."]},{"cell_type":"markdown","id":"b796bca1","metadata":{"papermill":{"duration":0.020637,"end_time":"2024-07-30T12:40:54.842076","exception":false,"start_time":"2024-07-30T12:40:54.821439","status":"completed"},"tags":[]},"source":["# Plot the results"]},{"cell_type":"code","execution_count":18,"id":"2ada3c9c","metadata":{"execution":{"iopub.execute_input":"2024-07-30T12:40:54.886176Z","iopub.status.busy":"2024-07-30T12:40:54.884469Z","iopub.status.idle":"2024-07-30T12:40:55.351661Z","shell.execute_reply":"2024-07-30T12:40:55.349803Z"},"papermill":{"duration":0.491615,"end_time":"2024-07-30T12:40:55.354212","exception":false,"start_time":"2024-07-30T12:40:54.862597","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZxN9R/H8c+56+wrxszYjd1YQ2IsIWRNiWiRPYRsZUkhpGSPUooWRWmTIhT6\nIaJkJ0uUdRjD7Mu95/fHZYxZ76x37pnX89Gjx8z3nvP9fs73zjXvOauiqqoAAADA+ekcXQAA\nAADyB8EOAABAIwh2AAAAGkGwAwAA0AiCHQAAgEYQ7AAAADSCYAcAAKARBDsAAACNcL5gF3Gi\nr6IoiqL4VZuV6ULW+OruJttiv9xMyPVaKSzx51fMHtPugTolfb2MBpOXf1DDVl1fXrz2piXt\n7Z3d9DolSw9t+jfrDbR/LGf0fLCnoijH45ILqP9Cnr39E+spitJx+8WC6Fwz8muWtP3RAIB8\nYXB0AbkXeWr6kdgJtdwy2IQbp6adiE3Kr7Wiz29ofV/PfeFxis5UulzFhtW8bl09/+eO7//Y\nvn7x4k827/uykZcpzSplKoW4ZJKZgzIaOi9jIQWzp2H2v7mqNWbX7gMGc7km95W1v//crQUA\nRY7qbK4f7yMiis4gIh2/PpvhMlt6VRYRo04RkZ8j43O9lqqqqjWhZ5CHiFR/7OXDl2PvlnHi\n1yFhgSLiX2d86k5cdYqI7LqVkJtty+FYzmhEkIeIHItNyv+uHTF71/Z/t3Llys2phkN6+TBL\nOXlzE6P/EBGvci/naITcrQUARY2zBjufypP1iuJf860MlrAm3edpMns17eDnkibY5XQtVVUj\nz0wWERffttEWa5o1LAkX63qYROSNf2+lNOYl2OV0LGdUcMGuOMxesZWjN5dgB6A4c75z7GxM\nnvePK+d548TLf6c7W+vW+bn7ohLLdZulFyXva904uFtE3AOecdel7U1nCpxRt4SI/Hw2Ku9b\nVMhjZUpNuJpkLdghCkaRmL2izhoTnz9nN6qW2LhES750ZQ/eXACwk7MGOxF5dnIdqyV23La0\nZ2QfmrlKRJ54pX6